//----------------------------------------------------------------------------//

double x2b_A1B2_A1B2_v1x::f_switch(const double& r, double& g) const {
    if (r > m_r2f) {
        g = 0.0;
        return 0.0;
    } else if (r > m_r2i) {
        const double t1 = M_PI / (m_r2f - m_r2i);
        const double x = (r - m_r2i) * t1;
        g = -std::sin(x) * t1 / 2.0;
        return (1.0 + std::cos(x)) / 2.0;
    } else {
        g = 0.0;
        return 1.0;
    }
}

//----------------------------------------------------------------------------//

double x2b_A1B2_A1B2_v1x::eval(const double* xyz1, const double* xyz2, const size_t ndim) const {
#ifdef DEBUG
    std::cerr << "\nEntering " << __func__ << " in " << __FILE__ << std::endl;
#endif

    std::vector<double> energies(ndim, 0.0);

    for (size_t j = 0; j < ndim; j++) {
        double mon1[9];
        double mon2[9];

        std::copy(xyz1 + j * 9, xyz1 + (j + 1) * 9, mon1);
        std::copy(xyz2 + j * 9, xyz2 + (j + 1) * 9, mon2);

        // ##DEFINE HERE## right now it assumes 1st atom of each monomer
        const double d12[3] = {mon1[0] - mon2[0], mon1[1] - mon2[1], mon1[2] - mon2[2]};

        const double r12sq = d12[0] * d12[0] + d12[1] * d12[1] + d12[2] * d12[2];
        const double r12 = std::sqrt(r12sq);

        if (r12 > m_r2f) continue;

        double xcrd[18];  // coordinates of real sites ONLY

        std::copy(mon1, mon1 + 9, xcrd);
        std::copy(mon2, mon2 + 9, xcrd + 9);

        double v[15];

        double sw = 0.0;
        double gsw = 0.0;

        const double* A_1_a = xcrd + 0;
        const double* B_1_a = xcrd + 3;
        const double* B_2_a = xcrd + 6;

        const double* A_1_b = xcrd + 9;
        const double* B_1_b = xcrd + 12;
        const double* B_2_b = xcrd + 15;

        variable vr[15];

        v[0] = vr[0].v_exp(m_d_intra_AB, m_k_intra_AB, A_1_a, B_1_a);
        v[1] = vr[1].v_exp(m_d_intra_AB, m_k_intra_AB, A_1_a, B_2_a);
        v[2] = vr[2].v_exp(m_d_intra_BB, m_k_intra_BB, B_1_a, B_2_a);

        v[3] = vr[3].v_exp(m_d_intra_AB, m_k_intra_AB, A_1_b, B_1_b);
        v[4] = vr[4].v_exp(m_d_intra_AB, m_k_intra_AB, A_1_b, B_2_b);
        v[5] = vr[5].v_exp(m_d_intra_BB, m_k_intra_BB, B_1_b, B_2_b);

        v[6] = vr[6].v_exp(m_d_AA, m_k_AA, A_1_a, A_1_b);
        v[7] = vr[7].v_exp(m_d_AB, m_k_AB, A_1_a, B_1_b);
        v[8] = vr[8].v_exp(m_d_AB, m_k_AB, A_1_a, B_2_b);

        v[9] = vr[9].v_exp(m_d_AB, m_k_AB, B_1_a, A_1_b);
        v[10] = vr[10].v_exp(m_d_BB, m_k_BB, B_1_a, B_1_b);
        v[11] = vr[11].v_exp(m_d_BB, m_k_BB, B_1_a, B_2_b);

        v[12] = vr[12].v_exp(m_d_AB, m_k_AB, B_2_a, A_1_b);
        v[13] = vr[13].v_exp(m_d_BB, m_k_BB, B_2_a, B_1_b);
        v[14] = vr[14].v_exp(m_d_BB, m_k_BB, B_2_a, B_2_b);

        sw = f_switch(r12, gsw);

        energies[j] = sw * polynomial::eval(coefficients.data(), v);
    }

    double energy = 0.0;
    for (size_t i = 0; i < ndim; i++) {
        energy += energies[i];
    }

#ifdef DEBUG
    std::cerr << std::scientific << std::setprecision(10);
    std::cerr << "\nExiting " << __func__ << " in " << __FILE__ << std::endl;
    std::cerr << "Input coordinates (1) for " << ndim << " monomers:\n";
    for (size_t i = 0; i < ndim; i++) {
        for (size_t j = 0; j < 9; j++) {
            std::cerr << xyz1[9 * i + j] << " , ";
        }
        std::cerr << std::endl;
    }
    std::cerr << "Input coordinates (2) for " << ndim << " monomers:\n";
    for (size_t i = 0; i < ndim; i++) {
        for (size_t j = 0; j < 9; j++) {
            std::cerr << xyz2[9 * i + j] << " , ";
        }
        std::cerr << std::endl;
    }
    std::cerr << "Output energy: " << energy << std::endl;
#endif

    return energy;
}

double x2b_A1B2_A1B2_v1x::eval(const double* xyz1, const double* xyz2, double* grad1, double* grad2, const size_t ndim,
                               std::vector<double>* virial) const {
    std::vector<double> energies(ndim, 0.0);

#ifdef DEBUG
    std::cerr << std::scientific << std::setprecision(10);
    std::cerr << "\nEntering " << __func__ << " in " << __FILE__ << std::endl;
    std::cerr << "Input coordinates (1) for " << ndim << " monomers:\n";
    for (size_t i = 0; i < ndim; i++) {
        for (size_t j = 0; j < 9; j++) {
            std::cerr << xyz1[9 * i + j] << " , ";
        }
        std::cerr << std::endl;
    }
    std::cerr << "Input coordinates (2) for " << ndim << " monomers:\n";
    for (size_t i = 0; i < ndim; i++) {
        for (size_t j = 0; j < 9; j++) {
            std::cerr << xyz2[9 * i + j] << " , ";
        }
        std::cerr << std::endl;
    }
    std::cerr << "Input gradients (1) for " << ndim << " monomers:\n";
    for (size_t i = 0; i < ndim; i++) {
        for (size_t j = 0; j < 9; j++) {
            std::cerr << grad1[9 * i + j] << " , ";
        }
        std::cerr << std::endl;
    }
    std::cerr << "Input gradients (2) for " << ndim << " monomers:\n";
    for (size_t i = 0; i < ndim; i++) {
        for (size_t j = 0; j < 9; j++) {
            std::cerr << grad2[9 * i + j] << " , ";
        }
        std::cerr << std::endl;
    }
    std::cerr << "Input virial:\n";
    for (size_t i = 0; i < 9; i++) {
        std::cerr << (*virial)[i] << " , ";
    }
    std::cerr << std::endl;
#endif

    for (size_t j = 0; j < ndim; j++) {
        double mon1[9];
        double mon2[9];

        std::copy(xyz1 + j * 9, xyz1 + (j + 1) * 9, mon1);
        std::copy(xyz2 + j * 9, xyz2 + (j + 1) * 9, mon2);

        // ##DEFINE HERE## right now it assumes 1st atom of each monomer
        const double d12[3] = {mon1[0] - mon2[0], mon1[1] - mon2[1], mon1[2] - mon2[2]};

        const double r12sq = d12[0] * d12[0] + d12[1] * d12[1] + d12[2] * d12[2];
        const double r12 = std::sqrt(r12sq);

        if (r12 > m_r2f) continue;

        double xcrd[18];  // coordinates of real sites ONLY

        std::copy(mon1, mon1 + 9, xcrd);
        std::copy(mon2, mon2 + 9, xcrd + 9);

        double v[15];

        double sw = 0.0;
        double gsw = 0.0;

        const double* A_1_a = xcrd + 0;
        const double* B_1_a = xcrd + 3;
        const double* B_2_a = xcrd + 6;

        const double* A_1_b = xcrd + 9;
        const double* B_1_b = xcrd + 12;
        const double* B_2_b = xcrd + 15;

        variable vr[15];

        v[0] = vr[0].v_exp(m_d_intra_AB, m_k_intra_AB, A_1_a, B_1_a);
        v[1] = vr[1].v_exp(m_d_intra_AB, m_k_intra_AB, A_1_a, B_2_a);
        v[2] = vr[2].v_exp(m_d_intra_BB, m_k_intra_BB, B_1_a, B_2_a);

        v[3] = vr[3].v_exp(m_d_intra_AB, m_k_intra_AB, A_1_b, B_1_b);
        v[4] = vr[4].v_exp(m_d_intra_AB, m_k_intra_AB, A_1_b, B_2_b);
        v[5] = vr[5].v_exp(m_d_intra_BB, m_k_intra_BB, B_1_b, B_2_b);

        v[6] = vr[6].v_exp(m_d_AA, m_k_AA, A_1_a, A_1_b);
        v[7] = vr[7].v_exp(m_d_AB, m_k_AB, A_1_a, B_1_b);
        v[8] = vr[8].v_exp(m_d_AB, m_k_AB, A_1_a, B_2_b);

        v[9] = vr[9].v_exp(m_d_AB, m_k_AB, B_1_a, A_1_b);
        v[10] = vr[10].v_exp(m_d_BB, m_k_BB, B_1_a, B_1_b);
        v[11] = vr[11].v_exp(m_d_BB, m_k_BB, B_1_a, B_2_b);

        v[12] = vr[12].v_exp(m_d_AB, m_k_AB, B_2_a, A_1_b);
        v[13] = vr[13].v_exp(m_d_BB, m_k_BB, B_2_a, B_1_b);
        v[14] = vr[14].v_exp(m_d_BB, m_k_BB, B_2_a, B_2_b);

        double g[15];

        // the switch
        sw = f_switch(r12, gsw);

        energies[j] = polynomial::eval(coefficients.data(), v, g);

        double xgrd[18];
        std::fill(xgrd, xgrd + 18, 0.0);

        double* A_1_a_g = xgrd + 0;
        double* B_1_a_g = xgrd + 3;
        double* B_2_a_g = xgrd + 6;

        double* A_1_b_g = xgrd + 9;
        double* B_1_b_g = xgrd + 12;
        double* B_2_b_g = xgrd + 15;

        vr[0].grads(g[0], A_1_a_g, B_1_a_g, A_1_a, B_1_a);
        vr[1].grads(g[1], A_1_a_g, B_2_a_g, A_1_a, B_2_a);
        vr[2].grads(g[2], B_1_a_g, B_2_a_g, B_1_a, B_2_a);

        vr[3].grads(g[3], A_1_b_g, B_1_b_g, A_1_b, B_1_b);
        vr[4].grads(g[4], A_1_b_g, B_2_b_g, A_1_b, B_2_b);
        vr[5].grads(g[5], B_1_b_g, B_2_b_g, B_1_b, B_2_b);

        vr[6].grads(g[6], A_1_a_g, A_1_b_g, A_1_a, A_1_b);
        vr[7].grads(g[7], A_1_a_g, B_1_b_g, A_1_a, B_1_b);
        vr[8].grads(g[8], A_1_a_g, B_2_b_g, A_1_a, B_2_b);

        vr[9].grads(g[9], B_1_a_g, A_1_b_g, B_1_a, A_1_b);
        vr[10].grads(g[10], B_1_a_g, B_1_b_g, B_1_a, B_1_b);
        vr[11].grads(g[11], B_1_a_g, B_2_b_g, B_1_a, B_2_b);

        vr[12].grads(g[12], B_2_a_g, A_1_b_g, B_2_a, A_1_b);
        vr[13].grads(g[13], B_2_a_g, B_1_b_g, B_2_a, B_1_b);
        vr[14].grads(g[14], B_2_a_g, B_2_b_g, B_2_a, B_2_b);

        for (int i = 0; i < 9; ++i) {
            xgrd[i] *= sw;
        }

        for (int i = 0; i < 9; ++i) {
            xgrd[i + 9] *= sw;
        }

        // gradient of the switch

        gsw *= energies[j] / r12;
        energies[j] *= sw;
        for (int i = 0; i < 3; ++i) {
            const double d = gsw * d12[i];
            xgrd[i] += d;
            xgrd[i + 9] -= d;
        }

        for (int i = 0; i < 9; ++i) {
            grad1[i + 9 * j] += xgrd[i];
        }

        for (int i = 0; i < 9; ++i) {
            grad2[i + 9 * j] += xgrd[i + 9];
        }

        if (virial != 0) {
            (*virial)[0] += -A_1_a[0] * A_1_a_g[0] - B_1_a[0] * B_1_a_g[0] - B_2_a[0] * B_2_a_g[0] -
                            A_1_b[0] * A_1_b_g[0] - B_1_b[0] * B_1_b_g[0] - B_2_b[0] * B_2_b_g[0];

            (*virial)[1] += -A_1_a[0] * A_1_a_g[1] - B_1_a[0] * B_1_a_g[1] - B_2_a[0] * B_2_a_g[1] -
                            A_1_b[0] * A_1_b_g[1] - B_1_b[0] * B_1_b_g[1] - B_2_b[0] * B_2_b_g[1];

            (*virial)[2] += -A_1_a[0] * A_1_a_g[2] - B_1_a[0] * B_1_a_g[2] - B_2_a[0] * B_2_a_g[2] -
                            A_1_b[0] * A_1_b_g[2] - B_1_b[0] * B_1_b_g[2] - B_2_b[0] * B_2_b_g[2];

            (*virial)[4] += -A_1_a[1] * A_1_a_g[1] - B_1_a[1] * B_1_a_g[1] - B_2_a[1] * B_2_a_g[1] -
                            A_1_b[1] * A_1_b_g[1] - B_1_b[1] * B_1_b_g[1] - B_2_b[1] * B_2_b_g[1];

            (*virial)[5] += -A_1_a[1] * A_1_a_g[2] - B_1_a[1] * B_1_a_g[2] - B_2_a[1] * B_2_a_g[2] -
                            A_1_b[1] * A_1_b_g[2] - B_1_b[1] * B_1_b_g[2] - B_2_b[1] * B_2_b_g[2];

            (*virial)[8] += -A_1_a[2] * A_1_a_g[2] - B_1_a[2] * B_1_a_g[2] - B_2_a[2] * B_2_a_g[2] -
                            A_1_b[2] * A_1_b_g[2] - B_1_b[2] * B_1_b_g[2] - B_2_b[2] * B_2_b_g[2];

            (*virial)[3] = (*virial)[1];
            (*virial)[6] = (*virial)[2];
            (*virial)[7] = (*virial)[5];
        }
    }

    double energy = 0.0;
    for (size_t i = 0; i < ndim; i++) {
        energy += energies[i];
    }

#ifdef DEBUG
    std::cerr << std::scientific << std::setprecision(10);
    std::cerr << "\nExiting " << __func__ << " in " << __FILE__ << std::endl;
    std::cerr << "Output energy: " << energy << std::endl;
    std::cerr << "Output gradients (1) for " << ndim << " monomers:\n";
    for (size_t i = 0; i < ndim; i++) {
        for (size_t j = 0; j < 9; j++) {
            std::cerr << grad1[9 * i + j] << " , ";
        }
        std::cerr << std::endl;
    }
    std::cerr << "Output gradients (2) for " << ndim << " monomers:\n";
    for (size_t i = 0; i < ndim; i++) {
        for (size_t j = 0; j < 9; j++) {
            std::cerr << grad2[9 * i + j] << " , ";
        }
        std::cerr << std::endl;
    }
    std::cerr << "Output virial:\n";
    for (size_t i = 0; i < 9; i++) {
        std::cerr << (*virial)[i] << " , ";
    }
    std::cerr << std::endl;
#endif

    return energy;
}

